 Preciosos cachorros de Braco de weimaraner de pura raza en color plata de ojos claros;
Machos de calidad,  con muy buen pedigree LOE nacidos el 2 de Mayo de 2020;
Entregas a finales de junio de 2020 en orden de reserva;
Camada compuesta por 4 machos y 2 hembras;
Disponibles sin reservar 2 machos. 
Enseñamos a los padres,  ejemplares de talla muy grande,  con mucho hueso,  preciosa estructura y pedigree nacional LOE. 
padre:  unos 67cm a la cruz;  y unos 37 kg ;
madre:  unos 62cm a la cruz; y unos 32kg;

Cria selectiva,  de calidad y responsable; 
Solo atendemos llamadas; Pedimos seriedad;
Los cachorros se entregarían con la siguiente documentacion oficial: 
•	pedigree LOE,  Inscripcion.  
•	vacunados y desparasitados
•	cartilla veterinaria oficial
*  Afijo de criador profesional. 

Con la situacion provocada por el coronavirus en caso de que en junio continue el estado de alarma os damos la posibilidad de entregar el cachorro en vuestra casa con transporte especializado,  urgente y exclusivo para cachorros.  Ademas teneis la posisbilidad de hacer el pago contrarrembolso ( e decir cuando os entreguen el cachorro )
Y por supuesto podeis venir a nuestro criadero (nuestra casa)familiar cualquier dia del año.
